import React from 'react';
import './App.css';

function App() {
  const getFeeds = () => {
    fetch('http://127.0.0.1:5002/api/v1/feeds')
    .then(response => response.json())
    .then(data => console.log(data?.data?.[0]?.title))
  }
  return (
    <div className="App">
      <div>{getFeeds.map((feed: any) => feed)}</div>
    </div>
  );
}

export default App;
